import {BUY_CAKE} from './cakeType'
const intialState={
    numOfCake:10
}

const reducer = (state=intialState,action)=>{
     switch(action.type){
        case BUY_CAKE:{
            return{
                ...state,
                numOfCake: numOfCake -1
            }
        }
     }
}
export default reducer
